import React from 'react';
import './App.css';
import { About } from './components/About';
import { Header } from './components/Header';
import { Resume} from './components/Resume';
import Navbar from './components/Navbar';
import { Contact } from './components/Contact';
import { Footer } from './components/Footer';
import Skills from './components/Skills';
import Particles from "react-particles-js";

function App ()  {

  return (
    <div className="App">
  <Particles
      params={{
        particles: {
          number: {
            value: 160,
            density: {
              enable: true,
              value_area: 1500,
            },
          },
          line_linked: {
            enable: false,
            opacity: 0.03,
          },
          move: {
            direction: "right",
            speed: 0.05,
          },
          size: {
            value: 1,
          },
          opacity: {
            anim: {
              enable: true,
              speed: 1,
              opacity_min: 0.05,
            },
          },
        },
        interactivity: {
          events: {
            onclick: {
              enable: true,
              mode: "push",
            },
          },
          modes: {
            push: {
              particles_nb: 1,
            },
          },
        },
        retina_detect: true,
      }}
    />
<Navbar />

      <Header />
<About />
<Resume />
<Skills />
<Contact />
<Footer />
    </div>

    )
}

export default App;
